import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { RouterModule } from '@angular/router';
import { SharedModule } from 'app/shared/shared.module';
import { JobInstanceService, JobInstanceComponent, jobInstanceRoute } from './';

const ENTITY_STATES = [...jobInstanceRoute];

@NgModule({
  imports: [SharedModule, RouterModule.forChild(ENTITY_STATES)],
  declarations: [JobInstanceComponent],
  entryComponents: [JobInstanceComponent],
  providers: [JobInstanceService],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class JobWebJobInstanceModule {}
